                    skill3:{name: "Spelling words comprised of the letter 'C'",level:0},
                    skill4:{name: "Confections and Sweet-craft", level:8}
                }
            }
        }
        }


        work = () => {
        this.state.education.map( (school) =>{
            return(
                <div key={school.name} >
                    <h3>{school.name}</h3>
                    <p></p>
                </div>
            )
        } )
        }


    render() {
        return (
            <div>

            </div>
        );
    }
}

export default Resume;
